package bind;

public class Cellule {
	private int numcellule;
	private int idproduit;
	private int numetagere;
	private int numrayon;
	public Cellule() {
		super();
		// TODO Auto-generated constructor stub
	}
	public int getNumcellule() {
		return numcellule;
	}
	public void setNumcellule(int numcellule) {
		this.numcellule = numcellule;
	}
	public int getIdproduit() {
		return idproduit;
	}
	public void setIdproduit(int idproduit) {
		this.idproduit = idproduit;
	}
	public int getNumetagere() {
		return numetagere;
	}
	public void setNumetagere(int numetagere) {
		this.numetagere = numetagere;
	}
	public int getNumrayon() {
		return numrayon;
	}
	public void setNumrayon(int numrayon) {
		this.numrayon = numrayon;
	}
	
	

}
